PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE Sendir (
					id VARCHAR(3) PRIMARY KEY, 
					stadur VARCHAR(30), 
					breidd FLOAT, 
					lengd FLOAT, 
					tidni FLOAT, 
					dBk FLOAT, 
					W FLOAT
				);
CREATE TABLE Punktur (
					id INTEGER PRIMARY KEY, 
					stadarlysing VARCHAR(50), 
					breidd FLOAT, 
					lengd FLOAT
				);
CREATE TABLE Maeling (
					sendir VARCHAR(3) NOT NULL, 
					punktur INTEGER NOT NULL, 
					dagsetning DATE, 
					svidstyrkur FLOAT NOT NULL, 
					fjarlaegd FLOAT, 
					stefna FLOAT,
					fravikshlutfall FLOAT,
          fjarlaegd1 FLOAT,
          leidni1 FLOAT,
          fjarlaegd2 FLOAT,
          leidni2 FLOAT,
          fjarlaegd3 FLOAT,
          leidni3 FLOAT,
          fjarlaegd4 FLOAT,
          leidni4 FLOAT,
					CONSTRAINT fk1 FOREIGN KEY (sendir)
            REFERENCES Sendir(id)
						ON UPDATE CASCADE
						ON DELETE RESTRICT,
					CONSTRAINT fk2 FOREIGN KEY (punktur)
            REFERENCES Punktur(id)
						ON UPDATE CASCADE
						ON DELETE RESTRICT
				);
COMMIT;
